\begin{tikzpicture}[x=1in,y=1in]
\clip(-2,-1.5) rectangle (2,1.5);

% Original triangle PQR
\draw[thick] (-1.5,-0.5) -- (1,1) -- (0.5,-1) -- cycle;

% Mark point Q with a filled circle
\fill (1,1) circle (0.08);
\node[above right] at (1,1) {Q};

% Label other vertices
\node[below left] at (-1.5,-0.5) {P};
\node[below right] at (0.5,-1) {R};

% Show rotation pattern with arrows and rotated positions
% 90° rotation around Q
\begin{scope}[rotate around={90:(1,1)}]
\draw[dashed, blue] (-1.5,-0.5) -- (1,1) -- (0.5,-1) -- cycle;
\end{scope}

% 180° rotation around Q
\begin{scope}[rotate around={180:(1,1)}]
\draw[dotted, red] (-1.5,-0.5) -- (1,1) -- (0.5,-1) -- cycle;
\end{scope}

% 270° rotation around Q
\begin{scope}[rotate around={270:(1,1)}]
\draw[dash dot, green] (-1.5,-0.5) -- (1,1) -- (0.5,-1) -- cycle;
\end{scope}

% Rotation arrows showing the pattern
\draw[->, thick, purple] (1.3,1) arc (0:90:0.3);
\draw[->, thick, purple] (0.7,1.3) arc (90:180:0.3);
\draw[->, thick, purple] (0.7,0.7) arc (180:270:0.3);
\draw[->, thick, purple] (1.3,0.7) arc (270:360:0.3);

\end{tikzpicture}
\end{document}

