\coordinate (S) at (3,0);
\coordinate (T) at (1.5,2.6);

% Draw triangle RST
\draw[thick] (R) -- (S) -- (T) -- cycle;

% Label vertices
\node[vertex,label=below left:$R$] at (R) {};
\node[vertex,label=below right:$S$] at (S) {};
\node[vertex,label=above:$T$] at (T) {};

% Draw angle labels
\angleLabel[0.3in]{(R)}{0}{45}{0.5}{$45°$}
\angleLabel[0.3in]{(S)}{120}{180}{0.5}{$60°$}

% Define transversal line points U and V
% U is on side RT, V is on side ST
\coordinate (U) at (0.6,1.04);
\coordinate (V) at (2.1,1.73);

% Draw transversal line UV (extend beyond triangle)
\draw[thick,blue] ($(U)!-0.5!(V)$) -- ($(V)!-0.5!(U)$);

% Label points U and V
\node[vertex,label=left:$U$] at (U) {};
\node[vertex,label=right:$V$] at (V) {};

\end{tikzpicture}
\end{document}

