\begin{tikzpicture}[x=0.3cm, y=0.3cm, z=0.2cm]

% Define coordinates for the main 6x2x2 structure
% Bottom layer (6x2 on base)
\coordinate (A1) at (0,0,0);
\coordinate (A2) at (6,0,0);
\coordinate (A3) at (6,2,0);
\coordinate (A4) at (0,2,0);

% Top of bottom layer
\coordinate (B1) at (0,0,1);
\coordinate (B2) at (6,0,1);
\coordinate (B3) at (6,2,1);
\coordinate (B4) at (0,2,1);

% Top layer (6x2 on top)
\coordinate (C1) at (0,0,2);
\coordinate (C2) at (6,0,2);
\coordinate (C3) at (6,2,2);
\coordinate (C4) at (0,2,2);

% 2x2x2 cube section underneath at left end
\coordinate (D1) at (0,0,-2);
\coordinate (D2) at (2,0,-2);
\coordinate (D3) at (2,2,-2);
\coordinate (D4) at (0,2,-2);

\coordinate (E1) at (0,0,-1);
\coordinate (E2) at (2,0,-1);
\coordinate (E3) at (2,2,-1);
\coordinate (E4) at (0,2,-1);

% Draw the main 6x2x2 structure
% Bottom face
\draw (A1) -- (A2) -- (A3) -- (A4) -- cycle;

% Middle level
\draw (B1) -- (B2) -- (B3) -- (B4) -- cycle;

% Top face
\draw (C1) -- (C2) -- (C3) -- (C4) -- cycle;

% Vertical edges of main structure
\draw (A1) -- (B1) -- (C1);
\draw (A2) -- (B2) -- (C2);
\draw (A3) -- (B3) -- (C3);
\draw (A4) -- (B4) -- (C4);

% Front face of main structure
\draw (A1) -- (A2) -- (B2) -- (B1) -- cycle;
\draw (B1) -- (B2) -- (C2) -- (C1) -- cycle;

% Right face of main structure
\draw (A2) -- (A3) -- (B3) -- (B2) -- cycle;
\draw (B2) -- (B3) -- (C3) -- (C2) -- cycle;

% Draw the 2x2x2 cube section underneath
% Bottom face of cube
\draw (D1) -- (D2) -- (D3) -- (D4) -- cycle;

% Middle level of cube
\draw (E1) -- (E2) -- (E3) -- (E4) -- cycle;

% Top face of cube (connects to main structure)
\draw (A1) -- (E1);
\draw (A4) -- (E4);

% Vertical edges of cube
\draw (D1) -- (E1) -- (A1);
\draw (D2) -- (E2);
\draw (D3) -- (E3);
\draw (D4) -- (E4) -- (A4);

% Front face of cube
\draw (D1) -- (D2) -- (E2) -- (E1) -- cycle;

% Right face of cube
\draw (D2) -- (D3) -- (E3) -- (E2) -- cycle;

% Additional connecting edge
\draw (E2) -- (2,0,0);
\draw (E3) -- (2,2,0);
\draw (2,0,0) -- (2,2,0);

% Hidden edges (dotted)
\draw[dotted] (A4) -- (A3);
\draw[dotted] (B4) -- (B3);
\draw[dotted] (C4) -- (C3);
\draw[dotted] (D4) -- (D3);
\draw[dotted] (E4) -- (E3);

\end{tikzpicture}
\end{document}

